[{'comment_id': 905082457, 'comment_body': "I was thinking instead of a parameters class, we could do something similar as we did for the SGD optimizer class, which acts as a baseline for other optimizers like Adam.

https://github.com/mlpack/ensmallen/blob/master/include/ensmallen_bits/adam/adam.hpp#L201

instantiates the SGD base optimizer which we use to call the Optimize function. We could call any function, e.g. let's say the base class implements a function to mutate the population, we could call that function in the extended optimizer as well, as long as the method is public.", 'comment_created': datetime.datetime(2022, 6, 23, 14, 19, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 905083156, 'comment_body': "I don't think we have to change the name.", 'comment_created': datetime.datetime(2022, 6, 23, 14, 19, 36, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 905084370, 'comment_body': 'This could go into a separate function, available for all other CMAES optimizer versions.', 'comment_created': datetime.datetime(2022, 6, 23, 14, 20, 39, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 922588756, 'comment_body': 'I looked into the parameter class, and I think we can implement this using the policy design pattern. I would restructure this by implementing a `StandardCMAES` policy first, which implements the classic CMAES method. Following something simple as, https://github.com/mlpack/ensmallen/blob/master/include/ensmallen_bits/adam/adam_update.hpp with the additional methods to initialize the CMAES parameters and something like https://github.com/mlpack/ensmallen/blob/master/include/ensmallen_bits/sgd/sgd_impl.hpp as the base class.', 'comment_created': datetime.datetime(2022, 7, 16, 0, 27, 45, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 922588804, 'comment_body': 'I can restructure the code, if you like, just let me know, should be straightforward. ', 'comment_created': datetime.datetime(2022, 7, 16, 0, 28, 13, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 924868263, 'comment_body': "I did some work on the separation, and I ended up with something more complex than what we already have. So I think we should just incorporate the weight policy, similar to what what we have right now but remove the extra parameter class and just put it into the `CMAES` class itself, as private parameters. For a different CMAES implementation we end up with some code duplication but I think it is way more readable if we have a separate implementation that doesn't share any code with the existing CMAES implementation. ", 'comment_created': datetime.datetime(2022, 7, 19, 19, 8, 3, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 924868993, 'comment_body': 'So I would put this into the CMAES class itself. and remove the `CMAparameters` class.', 'comment_created': datetime.datetime(2022, 7, 19, 19, 9, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 926191417, 'comment_body': 'Since the way I initialize the parameters is quite complicated and have to go through a top-down process to create the weight vector correctly. In the case of following your suggestion, I should put the "initialize_parameter" function in CMA standard class to create these parameters and declare them as private, is this approach sounds ok ? I implemented this function once inside CMAparameter class and you also suggested to put it back CMA standard in https://github.com/mlpack/ensmallen/pull/346#discussion_r905084370
```
  //! Initialize parameters
  template <typename SelectionPolicyType,
            typename WeightPolicyType>
  template<typename MatType>
  CMAES<SelectionPolicyType, WeightPolicyType>::
  initialize(
      MatType& iterate,
  )
  {

    chi = std::sqrt(iterate.n_elem)*(1.0 - 1.0 / (4.0 * iterate.n_elem) + 1.0 / (21 * std::pow(iterate.n_elem, 2)));
    if(lambda == 0)
      lambda = (4+std::round(3*std::log(iterate.n_elem)))*10;
  
    mu = std::round(lambda/2);

    weightPolicy.GenerateRaw(lambda);
    mu_eff = weightPolicy.Mu_eff();

    // Strategy parameter setting: Adaption
    cc = (4.0 + mu_eff/iterate.n_elem)/(4.0 + iterate.n_elem+2*mu_eff/iterate.n_elem);
    csigma = (mu_eff + 2.0)/(iterate.n_elem+mu_eff+5.0);
    c1 = 2 / (std::pow(iterate.n_elem+1.3, 2) + mu_eff);
    alphacov = 2.0;
    cmu = 2.0 * (mu_eff - 2.0 + 1.0 / mu_eff) / (std::pow(iterate.n_elem+2.0, 2) + alphacov*mu_eff/2);
    cmu = std::min(1.0 - c1, cmu);

    weights = weightPolicy.Generate(iterate.n_elem, c1, cmu);

    // Controlling
    dsigma = 1 + csigma + 2 * std::max(std::sqrt((mu_eff-1)/(iterate.n_elem+1)) - 1, 0.0);
    hsigma = (1.4 + 2.0 / (iterate.n_elem + 1.0)) * chi;
  
  }

```', 'comment_created': datetime.datetime(2022, 7, 21, 2, 12, 17, tzinfo=datetime.timezone.utc), 'commenter': 'JohnToro-CZAF', 'type': 'User'}, {'comment_id': 926193469, 'comment_body': 'Also, can you review the code: weight init policy? in case of you missed out my commits', 'comment_created': datetime.datetime(2022, 7, 21, 2, 17, 40, tzinfo=datetime.timezone.utc), 'commenter': 'JohnToro-CZAF', 'type': 'User'}, {'comment_id': 927916198, 'comment_body': 'The indentation was correct before, two spaces.', 'comment_created': datetime.datetime(2022, 7, 22, 18, 55, 57, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 927916309, 'comment_body': 'See comment above.', 'comment_created': datetime.datetime(2022, 7, 22, 18, 56, 8, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 927917152, 'comment_body': 'Looks like we can remove the lines, and change the alias above to a typedef, that way we can use it like `ActiveCMAES` instead of `ActiveCMAES<>`.', 'comment_created': datetime.datetime(2022, 7, 22, 18, 57, 27, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 927917295, 'comment_body': 'Can be removed now.', 'comment_created': datetime.datetime(2022, 7, 22, 18, 57, 40, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 927917867, 'comment_body': 'Can you make sure this fits into the 80 character line limit, see https://github.com/mlpack/mlpack/wiki/DesignGuidelines#line-length-and-wrapping for more information.', 'comment_created': datetime.datetime(2022, 7, 22, 18, 58, 37, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 927919182, 'comment_body': 'Do we need the extra `z` vector? Or can we directly use `Step[idx(j)] = arma::randn<BaseMatType>(iterate.n_rows, iterate.n_cols) * covLower;` instead of splitting it up into two seperate operations.', 'comment_created': datetime.datetime(2022, 7, 22, 19, 0, 50, tz